import logo from "./logo.svg";
import "./App.css";

function App() {
  //const names = ["Aram", "Ali", "Gity", "baba", "maman", "Elina", "Emad"];
  const users = [
    { name: "Ali", age: 44, email: "kardsfsdfdsami@kjh.com" },
    { name: "Awerewli", age: 33, email: "kadfsdrami@kjh.com" },
    { name: "Aldsfsdfi", age: 55, email: "kasdfsdsfddsfsdrami@kjh.com" }
  ];
  return (
    <div className="App">
      {
        users.map((user, index) => {
          return (
            <div key = {index}>
              <UserComponent name = {user.name} age = {user.age} email = {user.email}/>
          </div>
          );
        })
      }
    </div>
  );
}


const UserComponent = (props) => {
  return (
    <div>
      <h1>{props.name}</h1>
      <h2>{props.age}</h2>
      <h2>{props.email}</h2>
    </div>
  );
}

export default App;
